						<div className="chart-item-stitle"></div>
						<div className="chart-item-content"></div>
					</div>
					<div className="user-chart-list">
						<div className="chart-item-stitle"></div>
						<div className="chart-item-content"></div>
					</div>
					<div className="user-chart-list">
						<div className="chart-item-stitle"></div>
						<div className="chart-item-content"></div>
					</div>
				</div>
			</div>
		);
	}

	componentDidMount() {

	}

}

export default Home
